import styled from 'styled-components'
import avatar from '../../assets/avatar1.png';

const Avatar = () => {
    return (
        
             <AvatarImage src={avatar}> 
               </AvatarImage>
        
    );
};

const AvatarImage =styled.img`
    margin-left: 10px;
    width: 80px;
    height:60px;
    border-radius:30px;
`
